import { StatusBar } from 'expo-status-bar';
import React, {useState, useEffect} from 'react';
import { StyleSheet, Text, View, Button, Alert, TextInput, AppRegistry } from 'react-native';

const RegistrationScreen = () =>{
    return (
        <View style={styles.container}>
            <Text style={styles.colorr}>UCYP</Text>
            <TextInput
             placeholder="Username" 
             autoCapitalize="none"
             style={styles.inputStyle} />
            <TextInput 
            placeholder="Password" 
            autoCapitalize="none"
            style={styles.inputStyle}
            secureTextEntry={true} />
            <Button title="Log In" />
        </View>
    )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputStyle: {
      borderBottomColor: "#000",
      borderTopColor: "#000",
      borderLeftColor: "#000",
      borderRightColor: "#000",
      borderBottomWidth: 1,
      borderTopWidth: 1,
      borderLeftWidth: 1,
      borderRightWidth: 1,
      marginBottom: 5
  },
  colorr: {
    color: "black",
    fontSize: 40
  }
});

export default RegistrationScreen;
